    useEffect(() => {
        fetch(`api/v1/assignments/${assignmentId}`, {
            headers: {
                "Content-Type": "application/json",
                Authorization: `Bearer ${jwt}`,
            },
            method: "POST",
        }).then((response) => {
            if(response.status === 200) return response.json();
        }).then((assignment) =>{
